INSERT INTO `products` (`id`, `title`, `package_code`, `description`, `content`, `price`, `image`, `price_sale`, `agency_id`, `position`, `package_category_id`, `wasSale`, `status`, `created_at`, `updated_at`) VALUES
(1,	'Special HGP – Cancer Prevention',	'ICPC256456',	'Special HGP – Cancer Prevention: COMBO: SPECIAL PACKAGE FOR INDIVIDUAL AND FAMILY\n',	'<p><strong>COMBO: SPECIAL PACKAGE FOR INDIVIDUAL AND FAMILY</strong></p>\n<ol>\n<li><strong>GenoPAC Cancer &amp; Disease risk test &amp; analysis (26 types in Male and 27 types in Women),</strong></li>\n<li><strong>General health test and survey,</strong></li>\n<li><strong>Health consulting program with doctors from Thailand,</strong></li>\n</ol>\n<ul>\n<li>Genetic counseling</li>\n<li>Psychological counseling</li>\n<li>Healthcare solutions counseling</li>\n<li>Dietary and nutraceuticals counseling</li>\n</ul>\n<h4><strong>The first step towards Cancer &amp; Disease  prevention.</strong></h4>\n<h4>Please begin with <strong>\"Special or Premium HGP Package\" in Human Genome Program.</strong></h4>\n<p>iCareBasewill take one step forward to personal and tailored medicine, by identifying the risk of developing various cancers and diseases</p>\n<p></p>\n<img src=\"https://icarebase.com/wp-content/uploads/2019/01/healthcare-tech-300x165.jpg\" alt=\"\" style=\"float:none;height: ;width: \"/>\n<h3><strong>Why Human Genome Program?</strong></h3>\n<p><strong>Do you wish to understand? Your genes!!!  Knowledge will make difference…</strong></p>\n<p><strong>Genome Bioinformatics \"Human Genome Program\" - The age of preventive medicine.</strong></p>\n<p>Now is the time to analyze the genes of individuals and make health management in advance.  In order to maintain a high level of health, you need to identify important health-related  factors and consider how those factors will affect an individual\'s physical, emotional, and  social health functioning.</p>\n<p>The \"Human Genome Program” analyzes the individual genes involved in cancer and disease and presents comprehensive solutions for your health and a active life.</p>\n<p></p>\n<img src=\"https://icarebase.com/wp-content/uploads/2018/12/5b-300x225.jpg\" alt=\"\" style=\"float:none;height: ;width: \"/>\n<h3><strong>Who needs Human Genome Program?</strong></h3>\n<h4>Individual with family history</h4>\n<p>In case family members are concerned about the high incidence of cancer or heredity disease  you can be tested together, checked for risks and managed early.</p>\n<h4>Individual seeks for health checkup</h4>\n<p>A health checkup conducted at a hospital is a test to diagnose current problems on the blood by collecting  blood. GenoPAC testing analyzes the unchanging genes from birth to predict cancers or diseases that are genetically at risk, even if there are no current problems. Therefore, it is another form of health  checkup in the sense that it confirms the genetic health that was born and not the present condition.</p>\n<h4>Anyone interested in health care</h4>\n<p>If you are concerned about your health and wish to effectively manage your lifestyle,  you can use your personalized genetic tests to focus more on the areas of risk.</p>\n<h3><strong>What is GenoPAC Cancer &amp; Disease?</strong></h3>\n<p></p>\n<img src=\"https://icarebase.com/wp-content/uploads/2019/01/GENOPAC-CANCER-DISEASE-1-1024x878.png\" alt=\"\" style=\"float:none;height: ;width: \"/>\n<p>&nbsp;</p>\n',	2500,	'/uploads/products/special-hgp-–-cancer-prevention1565255830098.jpeg',	1500,	NULL,	2,	2,	0,	1,	'2019-07-05 03:44:58',	'2019-10-17 04:17:11'),
(3,	'Premium HGP – Cancer Prevention & Detox Holiday',	'ICPC20190806',	'Premium HGP – Cancer Prevention & Detox Holiday: COMBO: PREMIUM PACKAGE FOR INDIVIDUAL AND FAMILY',	'<p><strong>COMBO: PREMIUM PACKAGE FOR INDIVIDUAL AND FAMILY</strong></p>\n<ol>\n<li><strong>GenoPAC Cancer &amp; Disease risk test &amp; analysis (26 types in Male and 27 types in Women),</strong></li>\n<li><strong>General health test and survey,</strong></li>\n<li><strong>Health consulting program with doctors from Thailand,</strong></li>\n</ol>\n<ul>\n<li>Genetic counseling,</li>\n<li>Psychological counseling,</li>\n<li>Healthcare solutions counseling,</li>\n<li>Dietary and nutraceuticals counseling.</li>\n</ul>\n<ol>\n<li><strong>A 3-Day Health Wellness and Detox Holiday.</strong></li>\n</ol>\n<h4><strong>The first step towards Cancer &amp; Disease  prevention.</strong></h4>\n<h4>Please begin with <strong>\"Special or Premium HGP Package\" in Human Genome Program.</strong></h4>\n<p>iCareBasewill take one step forward to personal and tailored medicine, by identifying the risk of developing various cancers and diseases</p>\n<img src=\"https://icarebase.com/wp-content/uploads/2019/01/healthcare-tech-300x165.jpg\" alt=\"\" style=\"float:none;height: ;width: \"/>\n<h3><strong>Why Human Genome Program?</strong></h3>\n<p><strong>Do you wish to understand? Your genes!!!  Knowledge will make difference…</strong></p>\n<p><strong>Genome Bioinformatics \"Human Genome Program\" - The age of preventive medicine.</strong></p>\n<p>Now is the time to analyze the genes of individuals and make health management in advance.  In order to maintain a high level of health, you need to identify important health-related  factors and consider how those factors will affect an individual\'s physical, emotional, and  social health functioning.</p>\n<p>The \"Human Genome Program” analyzes the individual genes involved in cancer and disease and presents comprehensive solutions for your health and a active life.</p>\n<p></p>\n<h3><strong>Who needs Human Genome Program?</strong></h3>\n<h4>Individual with family history</h4>\n<p>In case family members are concerned about the high incidence of cancer or heredity disease  you can be tested together, checked for risks and managed early.</p>\n<h4>Individual seeks for health checkup</h4>\n<p>A health checkup conducted at a hospital is a test to diagnose current problems on the blood by collecting  blood. GenoPAC testing analyzes the unchanging genes from birth to predict cancers or diseases that are genetically at risk, even if there are no current problems. Therefore, it is another form of health  checkup in the sense that it confirms the genetic health that was born and not the present condition.</p>\n<h4>Anyone interested in health care</h4>\n<p>If you are concerned about your health and wish to effectively manage your lifestyle,  you can use your personalized genetic tests to focus more on the areas of risk.</p>\n<p></p>\n<h3><strong>What is GenoPAC Cancer &amp; Disease?</strong></h3>\n<p></p>\n<img src=\"https://icarebase.com/wp-content/uploads/2019/01/GENOPAC-CANCER-DISEASE-1-1024x878.png\" alt=\"undefined\" style=\"float:none;height: auto;width: auto\"/>\n<p></p>\n',	3000,	'/uploads/products/premium-hgp-–-cancer-prevention-detox-holiday1565255778511.jpeg',	2500,	NULL,	3,	2,	0,	1,	'2019-08-05 03:43:02',	'2019-10-17 04:19:12'),
